import React, { Component } from 'react';
import Product from './Product'

const Products = props => {
  return (
    <>
      <ul id="products-container">
        {
          props.items.map(item => {
            return <Product key={item.sku} item={item} />
          })
        }
        <hr/>
      </ul>
    </>
  )
}

export default Products;
